const checkPortalHasEmptyValue = (dataObj) => {
    if (!dataObj || typeof dataObj !== 'object') {
        return false;
    }

    const keys = Object.keys(dataObj);
    if (keys.length <= 1) {
        return true;
    }

    for (const key of keys) {
        if (dataObj[key] === "") {
            return true;
        }
    }
    return false;
}

const now = $now.toISO()
const obj = { ...$input.item.json }
delete obj['User ID']

if (!checkPortalHasEmptyValue(obj)) {
  obj['PortalBot Filled Out'] = now;
}
return obj

