const now = $now.toFormat("yyyy-MM-dd HH:mm:ss")
const leads = $('Get Leads Info').last().json
const emailSentTo = $('Loop Over Items1').item.json.email
const acitivtyIdUse = $('Webhook Email Sending').item.json.query.activity_id
const recordId = $('Webhook Email Sending').item.json.query.record_id

const salesEmail = leads['Emails That The Salesperson Email Were Sent To']
const emailSent = `Email: ${emailSentTo} \nDateTime: ${now} \nActivityId: ${acitivtyIdUse}`

return [{
  id: recordId,
  'Emails That The Salesperson Email Were Sent To': salesEmail ? `${salesEmail}\n---------------------\n\n${emailSent}` : emailSent,
  //'Initial Salesperson Email #98 Sent Date': now
}]

